import logo from './logo.svg';
import './App.css';
import { FormControl, FormLabel, Input } from '@chakra-ui/react';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <FormControl id="email">
        <FormLabel>Email address</FormLabel>
        <Input type="text" />
      </FormControl>
      <FormControl id="email">
        <FormLabel>Email address</FormLabel>
        <Input type="text" />
      </FormControl>
      </header>
    </div>
  );
}

export default App;
